// Imports
import React, { useContext, useState } from 'react';
import { Link, useLocation } from "react-router-dom";
import { userContext } from '../context/UserContext';
// Images
import logo1 from "../multimedia/logo1.png"
import logo2 from "../multimedia/logo2.png"
import facebook from "../multimedia/Facebook.svg"
import linkedin from "../multimedia/Linkedin.svg"
import intagram from "../multimedia/Instagram.svg"
import twitter from "../multimedia/Twitter.svg"
// CSS
import './styles/headerStyle.css'

const Header = () => {
    const userContextResult = useContext(userContext);
    console.log(userContextResult);
    const name = userContextResult.userInfo.name;
      const loggedIn = userContextResult.userJwt;
    const lastname = userContextResult.userInfo.lastName;
    const roleType = userContextResult.userInfo.role;
    // Posteriormente se hara con GlobalContext
    let jwk = '';
    // Hooks
    const location = useLocation();
    // States
    const [stateNavBar, setStateNavBar] = useState("div");
    const [stateOpen, setStateOpen] = useState("")
    // Methods
    const a = () => {
        if(stateNavBar === "div"){
            setStateNavBar("diiv")
            setStateOpen("open")
        }else{
            setStateNavBar("div")
            setStateOpen("");
        }
    }
    // Methods 
    const handleHeader = () => {
        if(location.pathname.toString() === '/login'){
            return '/register';
        }else if(location.pathname.toString() === '/register'){
            return '/login';
        }else if(location.pathname.toString() === '/' || location.pathname.toString() === '/product'){
            return ['/login', '/register']
        }
    }

    return(
        <React.Fragment>
            <header className = "Register__header">
                <Link to={"/"}> <img className = "header__img-mobile" src = {logo1} alt = "Icon Digital Booking" /> </Link>
                <Link to={"/"}> <img className = "header__img-desktop" src = {logo2} alt = "Icon Digital Booking" /> </Link>
                <div className = 'div__div-navBar'>
                    <div onClick = {a} className = "div__div">
                        <span className = {stateNavBar + "__span-line1"}></span>
                        <span className = {stateNavBar + "__span-line2"}></span>
                        <span className = {stateNavBar + "__span-line3"}></span>
                    </div>
                </div>

                <div>
                    {!loggedIn ? (null):(
                        <div className="container">
                        <div className="initialsContaine">
                            <span>{`${name.substring(0, 1)}${lastname.substring(0, 1)}`}</span>
                        </div>
                        <p>
                            <span className="greeting">Hola,</span>
                            <br />
                            {name} {lastname}
                        </p>
                        </div>
                    )}
                </div>

                <div className = {jwk === "true" ? 'disable' : ''}>
                    {location.pathname.toString() === '/' || location.pathname.toString() === '/product' ? handleHeader()?.map((l, index) => <div className = "div__div-button">
                        <Link
                        key={index}
                        to = {l}
                        className = "div__link"
                        >{l === '/login'? 'Inciar sesión' : 'Crear cuenta'}</Link>
                        </div>
                    ): <div className = "div__div-button"> 
                            <Link to={handleHeader()} className = "div__link">{handleHeader() === '/login'? 'Inciar sesión' : 'Crear cuenta'}</Link>
                        </div>}
                </div>
                <div className = {`div__div-dropdown ${stateOpen}`}>
                    <div className = "div__div-top">
                        <p>MENÚ</p>
                    </div>
                    {location.pathname.toString() === '/' || location.pathname.toString() === '/product' ? handleHeader()?.map((l, index) => 
                            <div className = "div__div-middle">
                                <Link
                                key = {index}
                                to = {l}
                                className = "div__div-middle-a"
                                >{l === '/login' ? 'Inciar sesión' : 'Crear cuenta'}</Link>
                            </div>
                        ): <div className = "div__div-middle"> 
                                <Link to={handleHeader()} className = "div__div-middle-a">{handleHeader() === '/login'? 'Inciar sesión' : 'Crear cuenta'}</Link>
                            </div>}
                    <div className = "div__div-bottom">
                        <img className = "div__img-facebook" src = {facebook} alt = "Icon facebook" />
                        <img src = {linkedin} alt = "Icon linkedin" />
                        <img src = {intagram} alt = "Icon intagram" />
                        <img src = {twitter} alt = "Icon twitter" />
                    </div>
                </div>
            </header>
        </React.Fragment>
    )
}

// Exports

export { Header };
